import{H as e}from"./header-803da00b.js";import{F as t}from"./footer-7ae1119f.js";import{o as i,c as r,a,F as o,f as A}from"./index-4ea004f4.js";import"./logo-80a8da4e.js";const n=A('<main class="container mt-4"><div class="superior"><h1>Capitulo 4</h1></div><h2 id="animacion">Conclusiones</h2> <img id="animacion" src="data:image/jpeg;base64," alt=""><table class="table table-bordered table-striped" id="animacion"><tr><td colspan="2"><p style="text-align:justify;"> Así se logró poner en marcha un sistema eficiente y ágil mediante la implementación exitosa de una aplicación desarrollada con Flutter. Esta plataforma de desarrollo proporcionó una base sólida para nuestra interfaz de usuario, permitiéndonos superar las expectativas al ofrecer una experiencia visualmente atractiva y altamente intuitiva. </p></td></tr><tr><td colspan="2"><p style="text-align:justify;"> La aplicación, construida con Flutter, no solo cumplió, sino que sobrepasó nuestras expectativas en términos de eficiencia y flexibilidad. La interfaz de usuario resultante no solo es estéticamente agradable, sino que también ofrece una navegación fluida y una experiencia de compra altamente intuitiva. </p></td></tr><tr><td colspan="2"><p style="text-align:justify;"> La capacidad multiplataforma de Flutter ha sido esencial para garantizar una presencia uniforme en diversas plataformas, mejorando así la accesibilidad para nuestros usuarios. La ventaja de desarrollar una única base de código para múltiples plataformas no solo simplifica el proceso de desarrollo, sino que también garantiza una coherencia notable en la experiencia del usuario en diferentes dispositivos. </p></td></tr><tr><td colspan="2"><p style="text-align:justify;"> Además, la flexibilidad de personalización proporcionada por Flutter ha sido un factor clave para adaptar la aplicación a las necesidades específicas de nuestros usuarios. Esta capacidad de adaptación asegura que la plataforma no solo sea funcional, sino también capaz de ajustarse a las preferencias individuales de cada usuario. </p></td></tr></table><h2 id="animacion">Recomendaciones</h2> <img id="animacion" src="data:image/png;base64," alt=""><table class="table table-bordered table-striped" id="animacion"><tr><td> Las recomendaciones que se pueden dar son: <ul style="text-align:justify;"><li> Mantenimiento Regular de Dependencias de Flutter: Realiza actualizaciones periódicas de las dependencias de Flutter y las bibliotecas de terceros utilizadas en la aplicación. </li><li> Optimización del Rendimiento: Continúa monitoreando y optimizando el rendimiento de la aplicación. Flutter proporciona herramientas para evaluar y mejorar el rendimiento, como el perfilador incorporado. </li><li> Personalización Continua y Feedback del Usuario: Establece canales para recopilar y analizar el feedback de los usuarios. Utiliza esta información para realizar mejoras continuas en la personalización de la aplicación. </li><li> Exploración de Nuevas Características de Flutter: Mantente informado sobre las nuevas características y capacidades que se introduzcan en Flutter. Explora cómo estas características pueden mejorar la experiencia del usuario o simplificar el desarrollo. </li><li> Integración de un sistema de pago: Agregar algún método de pago que esté vinculado tanto para billeteras virtuales o el manejo de una cuenta de banco para finalizar el pago del producto. </li><li> Integración de un socio externo: La aplicación al tratarse de compra y venta, las empresas y consumidores estarán interesados en las entregas a domicilio de un producto. </li></ul></td></tr></table><h2 id="animacion">Fuentes de Información</h2> <img id="animacion" src="data:image/jpeg;base64," alt=""><table class="table table-bordered table-striped" id="animacion"><tr><td> Bibliografía: <ul><li> [Sistema web integrado de control de inventario, pedidos y distribución para el departamento comercial de la empresa&quot; FADERPA LTDA&quot;. Periodo 2022]. (proyecto de grado) </li><li> Sillo, J. (2019, 23 de mayo). Procedimiento para la publicación de los sistemas informáticos en el Repositorio Estatal de Software Libre. </li><li> Código de comercio boliviano. (2022, 20 de septiembre). Gaceta oficial de Bolivia. </li><li>ELINSIGNA. (2018). Origen del inventario.</li><li> Silberschatz, A., Korth, H. F., &amp; Sudarshan, S. (2010). Database System Concepts (6ta ed.). McGraw-Hill. </li><li>HUBSPOT. (2021). Control de inventarios.</li><li> OMG. (2017). Unified Modeling Language (UML) - Superstructure, Version 2.5. OMG Document Number: formal/2017-12-05. </li><li>Oracle Corporation. (2021). MySQL.</li><li>PHP. (2001). PHP: Hypertext Preprocessor.</li><li>W3C. (s. f.). HTML. Recuperado el 13 de mayo de 2023</li><li> Mozilla Developer Network. (s. f.). JavaScript. Recuperado el 13 de mayo de 2023 </li></ul></td></tr><tr id="animacion"><td id="animacion"> Webgrafía: <ul><li><a href="https://www.digital.gob.bo/2019/05/procedimiento-para-la-publicacion-de-los-sistemas-informaticos-en-el-repositorio-estatal-de-software-libre/">Procedimiento para la publicación de los sistemas informáticos en el Repositorio Estatal de Software Libre</a></li><li><a href="https://www.derechoteca.com/gacetabolivia/codigo-de-comercio-boliviano-vigente-y-actualizado">Código de comercio boliviano vigente y actualizado</a></li><li><a href="https://elinsignia.com/2018/06/19/origen-del-inventario/">Origen del inventario</a></li><li><a href="https://blog.hubspot.es/sales/que-es-control-de-inventarios">Control de inventarios</a></li><li><a href="https://www.mysql.com/">MySQL</a></li><li><a href="https://www.php.net/">PHP: Hypertext Preprocessor</a></li><li><a href="https://www.w3.org/html/">HTML</a></li><li><a href="https://developer.mozilla.org/es/docs/Web/JavaScript">JavaScript</a></li><li><a href="https://getbootstrap.com/">Bootstrap</a></li></ul></td></tr></table></main>',1),Q={__name:"capitulo4",setup(l){return(c,d)=>(i(),r(o,null,[a(e),n,a(t)],64))}};export{Q as default};
